import React from 'react'
function Options(props){
    return(
        <div>
            <img onClick = {() => props.clicked(1)} alt =''/>
            <img onClick = {() => props.clicked(2)} alt =''/>
            <img onClick = {() => props.clicked(3)} alt =''/>
            <img onClick = {() => props.clicked(4)} alt =''/>
        </div>
    )
}
export default Options
